window.bookSummaryJSON = "<p><b>Discover what happens when a young woman from a family of demon hunters falls in love with the prince of hell in this spicy paranormal romance.</b></p> <p>It's been five years since her sister was killed by a demon and Camille Morgan swore off the family business of demon hunting. Now a college sophomore, Cami is determined to get her degree and move far away from Seattle—and all things paranormal.</p> <p>When Cami becomes the target of a demon attack she's convinced is a ploy by her parents to drag her back into training, the wildly charming and attractive Xander Kane comes to her rescue. But her savior isn't a hunter—or even human.</p> <p>Xander is a demon, the alluring prince of hell whose magnetic presence leaves Cami both captivated and conflicted, especially when she finds out he plans on using her to destroy the demon hunters once and for all.</p> <p>Caught between her growing affection for Xander and her loyalty to her family, Cami struggles to make a decision that could shatter her and endanger the lives of those she loves.</p>"; 
